import React from 'react';
import styled from 'styled-components';

const Title = styled.h1`
  color: #fff;
  margin: 0;
  font-family: 'Do Hyeon';
  font-size: 50px;
  letter-spacing: 2px;
  span {
    color: #06a6ff;
  }
`;

const Header = styled.nav`
  width: 100%;
  background-color: #0c0a26;
  height: 100px;
  display: flex;
  align-items: center;
  padding: 0px 30px;
`;

export default function Index() {
  return (
    <>
      <Header>
        <Title>
          Rotzz.<span>gg</span>
        </Title>
      </Header>
      <div
        style={{
          width: `100%`,
          height: `700px`,
          backgroundImage: `url(/background-image.jpg)`,
          backgroundColor: `rgba(46, 45, 45, .7)`,
          backgroundSize: `cover`,
        }}
      ></div>
    </>
  );
}
